import React, {Component} from 'react';
import './Header.css';
import * as PubSub from 'pubsub-js'

var Scroll = require('react-scroll');
var Link = Scroll.Link;

class Header extends Component {

    constructor(props) {
        super(props);
        console.log(PubSub);

        this.state = {
            showCurtain: 0,
            display: 'none',
            short: false,
            opacity: 0.7,
            shorturl: '',
            opacityResult: 0,
            opacityWaiting: 0,
            opacityError: 0,
            fat:'data:image/png;base64,',
            thin: 'data:image/png;base64,'
        };

    }



    componentWillMount() {
        const self = this;

        PubSub.subscribe('showCurtain', function(topic, product) {
            self.setState({
                showCurtain: 0.7,
                display: 'block',
                opacityResult: 0
            })
        })

        PubSub.subscribe('hideCurtain', function(topic, product) {
            self.setState({
                showCurtain: 0,
                display: 'block'
            })
        })

        PubSub.subscribe('hideResult', function(topic, product) {
            self.setState({
                opacityResult: 0
            })
        })

        PubSub.subscribe('showResult', function(topic, product) {
            self.setState({
                opacityResult: 1
            })
        })


        PubSub.subscribe('triggerError', function(topic, product) {
            self.setState({
                opacityError: 1,
            })
        })


        PubSub.subscribe('hideError', function(topic, product) {
            self.setState({
                opacityError: 0,
            })
        })


        PubSub.subscribe('showThin', function(topic, product) {
            self.setState({
                short: true,
                opacity: 1

            })
        })

        PubSub.subscribe('showFat', function(topic, product) {
            self.setState({
                short: false,
                opacity: 0.4
            })
        })

        PubSub.subscribe('setResult', function(topic, product) {
            console.log(product.url);
            self.setState({
                shorturl: 'http://' + product.url + '.urlsh.me'
            })
        })

        PubSub.subscribe('startLoading', function(topic, product) {
            self.setState({
                opacityWaiting: 1
            })
        })

        PubSub.subscribe('endLoading', function(topic, product) {
            self.setState({
                opacityWaiting: 0
            })
        })
    }

  copyShortLink(){
    //first selecting the text
    var range = document.createRange(),
    selection = window.getSelection();
    range.selectNodeContents(this.refs.shorturl);
    selection.removeAllRanges();
    selection.addRange(range);
    //now copying to clipboard
    try {
      var successful = document.execCommand('copy');
      var msg = successful ? 'successful' : 'unsuccessful';
      console.log('Copying text command was ' + msg);
    } catch (err) {
      console.log('Oops, unable to copy');
    }
  }

    render() {
        return (
            <div>
              <div className="cs-full">
                <div className="spinner" style={{opacity: this.state.opacityWaiting} }></div>

              <div className="cs-curtain" style={{opacity: this.state.showCurtain }}></div>

              <h1 className="cs-logo">URLSH!<span>subdomain and popular short urls</span></h1>

              <img style={{opacity:this.state.opacity, transition:'1s all'}} className="cs-char" src={this.state.short ? this.state.thin : this.state.fat }/>

                {this.props.children}
                <p style={{opacity:this.state.opacityResult, transition:'1s all'}}  className="cs-shortlink">
                  <span>
                    <a target="_blank" href={this.state.shorturl} ref="shorturl">{this.state.shorturl}</a>
                    <span className="fa fa-clipboard" onClick={this.copyShortLink.bind(this)}></span>
                  </span>
                </p>
                <p style={{opacity:this.state.opacityError, transition:'1s all'}}  className="cs-error">make sure the url format is correct</p>


                <p className="cs-see-more">
                <Link activeClass="active" to="results" spy={false} smooth={true} offset={0} duration={1000} >
                  see popular links
                </Link>
              </p>

            </div>
          <div className="decoration5"></div>

            <div className="decoration4"></div>
            <div className="decoration6"></div>


            </div>
        )
    }
}


export default Header;
